import React from 'react'
import { render } from 'react-dom'
import Highcharts from 'highcharts'
import HighchartsReact from 'highcharts-react-official'


const options = {
    
  credits:{
    enabled:false,
  },
  title: {
    text: 'WhatApp - Últimas 24 horas'
  },
  legend: {
    align: 'right',
    verticalAlign: 'top',
    layout: 'vertical',
    x: 0,
    y: 100,
    squared
},
  series: [{
    name:'Brasil',
    data: [0, 1, 3.5],
    color: '#76E6D9',
    type:'area'
  }
  ,
  { 
    name:'México',
    data:[0,2,5],
    color:'#915DFF',
    type:'area'
  }

]

}


const Wchart = () => {


  
    return ( 
        <>
        <div className="wchart-container">
                <HighchartsReact
            highcharts={Highcharts}
            options={options}
        />
        </div>
        </>
     );
}
 
export default Wchart;
